      var shipRotation = Math.PI * 2 / 240;

      var stage = new Kinetic.Stage({
        container: 'container',
        width: 1200,
        height: 800
      });

      var layer = new Kinetic.Layer();

      var bgRect = new Kinetic.Rect({
        x: 0,
        y: 0,
        width: 1200,
        height: 800,
        fill: 'black',
      });

  stageBuilder:addWall(250, 200, 100, 100)

  stageBuilder:addWall(250, 500, 100, 100)

*/
      var wallRect1 = new Kinetic.Rect({

        y: 200,
        width: 100,
        height: 100,
        fill: 'white'
      });

      var wallRect2 = new Kinetic.Rect({
        x: 850,
        y: 200,
        width: 100,
        height: 100,
        fill: 'white'
      });

      var wallRect3 = new Kinetic.Rect({
        x: 250,
        y: 500,
        width: 100,
        height: 100,
        fill: 'white',
        strokeWidth: 0
      });

      var wallRect4 = new Kinetic.Rect({
        x: 850,
        y: 500,
        width: 100,
        height: 100,
        fill: 'white',
        strokeWidth: 0
      });

      var shipCircle = new Kinetic.Circle({
        x: 0,
        y: 0,
        radius: 8.15,
        fill: 'black',
        stroke: 'white',
        strokeWidth: 1.7
      });

      var shipDot1 = new Kinetic.Circle({
        x: 0,
        y: -3,
        radius: 1.46,
        fill: "#00ff00",
        strokeWidth: 0
      });

      var shipDot2 = new Kinetic.Circle({
        x: -2.845,
        y: 1.6425,
        radius: 1.46,
        fill: "#00ff00",
        strokeWidth: 0
      });

      var shipDot3 = new Kinetic.Circle({
        x: 2.845,
        y: 1.6425,
        radius: 1.46,
        fill: "#00ff00",
        strokeWidth: 0
      });

      var shipName = new Kinetic.Text({
        x: 0,
        y: 20,
        text: '',
        fontSize: 14,
        fontFamily: 'Ubuntu, Arial, Tahoma, sans-serif',
        fill: 'white'
      });

      var shipDotGroup = new Kinetic.Group({x: 0, y: 0});
      shipDotGroup.add(shipDot1);
      shipDotGroup.add(shipDot2);
      shipDotGroup.add(shipDot3);

      var shipGroup = new Kinetic.Group({x: 0, y: 0});
      shipGroup.add(shipCircle);
      shipGroup.add(shipDotGroup);
      shipGroup.add(shipName);

      layer.add(bgRect);
      layer.add(wallRect1);
      layer.add(wallRect2);
      layer.add(wallRect3);
      layer.add(wallRect4);

      var values = replayData.split(":");
      var numShips = parseInt(values[0], 16);
      var ships = new Array();
      var shipOrbits = new Array();
      for (var x = 0; x < numShips; x++) {
        var base = 1 + (x * 4);
        ships[x] = shipGroup.clone();
        ships[x].getChildren()[0].setStroke(values[base + 0]);
        var shipDots = ships[x].getChildren()[1].getChildren();
        shipDots[0].setFill(values[base + 1]);
        shipDots[1].setFill(values[base + 1]);
        shipDots[2].setFill(values[base + 1]);
        var shipName = ships[x].getChildren()[2];
        shipName.setText(values[base + 3]);
        shipName.setOffset({x: shipName.getWidth() / 2 });
        layer.add(ships[x]);
        shipOrbits[x] = (Math.random() < 0.5 ? 1 : -1);
      }

      stage.add(layer);

      var gameTime = 1;
      var base = (1 + (numShips * 4));
      var anim = new Kinetic.Animation(function(frame) {
        var time = frame.time,
            timeDiff = frame.timeDiff,
            frameRate = frame.frameRate;
        for (var x = 0; x < numShips; x++) {
          var shipHexX =
              values[base + ((gameTime - 1) * numShips * 2) + (x * 2)];
          var shipHexY =
              values[base + ((gameTime - 1) * numShips * 2) + (x * 2) + 1];
          ships[x].setX(parseInt(shipHexX, 16) / 10);
          ships[x].setY(800 - parseInt(shipHexY, 16) / 10);
          var shipDotGroup = ships[x].getChildren()[1];
          shipDotGroup.setRotation(
              shipDotGroup.getRotation() + (shipRotation * shipOrbits[x]));
        }
        gameTime++;
        var scale = Math.min(window.innerWidth / stage.getWidth(),
                             window.innerHeight / stage.getHeight());
        stage.setScale(Math.min(1, scale, scale));
      }, layer);

      anim.start();
